<?php

namespace App\Tests\Controller\Api;

use Symfony\Bundle\FrameworkBundle\Test\WebTestCase;


class OrigenDatosControllerTest extends WebTestCase
{
    private $accessToken="";
    private $client;
    private $id;

    public function setUp(): void
    {
        $this->Register();
        $this->GetLoginCheckAction();
        parent::setUp();
    }

    public function Register()
    {    
        self::ensureKernelShutdown();
        $this->client = static::createClient(); 
        self::ensureKernelShutdown();
        $this->client->request(
            'POST',
            '/api/register',
            [],
            [],
            ['CONTENT_TYPE' => 'application/json'],
             '{
                "username": "usuario@dominio.com",
                "password": "123456",
                "roles": "ROLE_USER"
              }'
        );
        $response = $this->client->getResponse()->getContent();
        $jsonContent = json_decode($response, 'json');
        $this->accessToken = "Bearer " . $jsonContent['token']; 
        $this->assertNotEmpty($jsonContent['token']);
    }

    public function GetLoginCheckAction()
    {    
        self::ensureKernelShutdown();
        $this->client = static::createClient(); 
        self::ensureKernelShutdown();
        $this->client->request(
            'POST',
            '/api/login_check',
            [],
            [],
            ['CONTENT_TYPE' => 'application/json'],
             '{
                "_username": "usuario@dominio.com",
                "_password": "123456"
              }'
        );
        $response = $this->client->getResponse()->getContent();
        $jsonContent = json_decode($response, 'json');
        $this->accessToken = "Bearer " . $jsonContent['token']; 
        $this->assertNotEmpty($jsonContent['token']);
    }

    
    public function testAltaOrigenDatos()
    {
        $this->client->request(
            'POST',
            '/api/v1/descripciondatos',
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{
                "identificacion": "1dentificacion",
                "denominacion": "denominacion",
                "descripcion": "descripcion",
                "frecuenciaActulizacion": "Anual",
                "fechaInicio": "2021-01-19 00:00",
                "fechaFin": "2021-01-31 00:00",
                "territorio": "Aragon",
                "instancias": "instancias",
                "usuario": "usuario@dominio.com",
                "sesion": "121342456",
                "estado": "BORRADOR",
                "estadoAlta": "1.1 descripcion"
              }'
        );
        
        $response=$this->client->getResponse()->getContent();
        $jsonContent = json_decode($response, 'json');
        $identidad = $jsonContent['id'];

        $this->client->request(
            'POST',
            '/api/v1/origendatos/data',
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{
                "idDescripcion" : "' . $identidad . '",
                "tipoOrigen": "file",
                "data" : "data:application/xml;base64,",
                "usuario": "usuario@dominio.com",
                "sesion": "121342456"
              }'
        );
        
        $response=$this->client->getResponse()->getContent();
        $jsonContent = json_decode($response, 'json');
        $this->id = $jsonContent['id'];
        $this->assertEquals(201, $this->client->getResponse()->getStatusCode());
 
        $url = "/api/v1/origendatos/data/". $this->id;
        $this->client->request(
            'POST',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{
                "idDescripcion" : "' . $identidad . '",
                "tipoOrigen": "url",
                "data": "http://localhost:8080/storage/default/Libro1.json",
                "usuario": "usuario@dominio.com",
                "sesion": "121342456"
              }'
        );  
        $this->assertEquals(202, $this->client->getResponse()->getStatusCode());

        $url = "/api/v1/origendatos/". $this->id;
        $this->client->request(
            'DELETE',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{}'
        );  
        $this->assertEquals(204, $this->client->getResponse()->getStatusCode());

        $url = "/api/v1/origendatos/database";
        $this->client->request(
            'POST',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{
                "idDescripcion" : "' . $identidad . '",
                "tipoOrigen": "database",
                "tipoBaseDatos": "MYSQL",
                "host": "localhost",
                "puerto": "3306",
                "servicio": "_",
                "esquema": "asistente_conjuntos",
                "tabla": "user",
                "usuarioDB": "root",
                "contrasenaDB": "adminDP25@",
                "usuario": "usuario@dominio.com",
                "sesion": "121342456"
            }'
        );
        $response=$this->client->getResponse()->getContent();
        $jsonContent = json_decode($response, 'json');
        $this->id = $jsonContent['id'];  
        $this->assertEquals(201, $this->client->getResponse()->getStatusCode());

        $url = "/api/v1/origendatos/database/" . $this->id;
        $this->client->request(
            'POST',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{
                "idDescripcion" : "' . $identidad . '",
                "tipoOrigen": "BASEDATOS",
                "tipoBaseDatos": "MYSQL",
                "host": "localhost",
                "puerto": "3306",
                "servicio": "_",
                "esquema": "asistente_conjuntos",
                "tabla": "user",
                "usuarioDB": "root",
                "contrasenaDB": "adminDP25@",
                "usuario": "usuario@dominio.com",
                "sesion": "121342456"
            }'
        );  
        $this->assertEquals(202, $this->client->getResponse()->getStatusCode());


        $alinecionRelaciones = '{"BusinessEntityID":"http://opendata.aragon.es/def/ei2a/categorization#1","Title":"http://opendata.aragon.es/def/ei2a/categorization#12","FirstName":"http://opendata.aragon.es/def/ei2a/categorization#13",}';
        $alinecionRelaciones  = base64_encode($alinecionRelaciones);
        $url = "/api/v1/origendatos/alineacion/". $this->id;
        $this->client->request(
            'POST',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
             '{
                "alineacionEntidad": "http://purl.oclc.org/NET/ssnx/ssn#Accuracy",
                "alineacionRelaciones": "' .  $alinecionRelaciones . '",
                "usuario": "usuario@dominio.com",
                "sesion": "121342456"
            }'
        );  

        $this->assertEquals(202, $this->client->getResponse()->getStatusCode());

        $url = "/api/v1/origendatos/". $this->id;
        $this->client->request(
            'DELETE',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{}'
        );  
        $this->assertEquals(204, $this->client->getResponse()->getStatusCode());

        $url = "/api/v1/descripciondatos/" . $identidad;
        $this->client->request(
            'DELETE',
            $url,
            [],
            [],
            ['CONTENT_TYPE' => 'application/json',
             'ACCEPT' => 'application/json',
             'HTTP_AUTHORIZATION' =>  $this->accessToken],
            '{}'
        );  
        $this->assertEquals(204, $this->client->getResponse()->getStatusCode());

    }
}